import React, { useRef, useState } from "react";
import RegisterImg from "../../images/registerImg.png";

export default function Registration() {
  const [UserFieldsData, setUserFieldsData] = useState({fullname:"",email:"","password":""});

  function HandleFields(e) {
    setUserFieldsData({...UserFieldsData,[e.target.name]:[e.target.value]});
    console.log(UserFieldsData)
  }

  const HandleSignupForm = (e) => {
    e.preventDefault();

    const UserData = {
    //   name: Fullname.current.value,
    //   email: Email.current.value,
    //   password: Password.current.value,
    };
    console.log(UserData);
  };
  return (
    <>
      <div className="reg-wrapper">
        <div className="reg-container">
          <div className="reg-banner">
            <img src={RegisterImg} />
          </div>
          <div className="reg-content">
            <div className="reg-content-head">
              <span> Hey there,</span>
              <h2 className="">Register Your Account</h2>
              <p>
                Sign up for our blog and stay up-to-date with the latest news
                and insights.
              </p>
              <div className="submit-btn">
                <button type="submit" className="outh-toggle">
                  <i className="fa-brands fa-google text-light me-1"></i>
                  Login Via Google
                </button>
              </div>
              <div className="or"></div>
            </div>
            <form
              method="post"
              onSubmit={HandleSignupForm}
              className="input-box"
            >
              <div>
                <label htmlFor="fullname">Full Name</label>
                <input
                  onChange={HandleFields}
                //   ref={FullnameRef}
                  type="text"
                  placeholder="Enter your full name"
                  id="fullname"
                  autoComplete="name"
                  name="fullname"
                />
              </div>
              <div>
                <label htmlFor="email">Email</label>
                <input
                  onChange={HandleFields}
                //   ref={EmailRef}
                  type="email"
                  id="email"
                  placeholder="Enter  your email address"
                  autoComplete="email"
                  name="email"
                />
              </div>
              <div>
                <label htmlFor="password">Password</label>
                <input
                  onChange={HandleFields}
                //   ref={PasswordRef}
                  type="password"
                  id="password"
                  placeholder="Enter a strong password"
                  name="password"
                  autoComplete="current-password"
                />
              </div>
              <div className="checkbox-wrapper">
                <div className="check-box">
                  <input type="checkbox" id="rememberMe" />
                  <label htmlFor="rememberMe" className="align-middle">
                    Remember me
                  </label>
                </div>
                <div className="reg-already">
                  Already have account<a to="/login">Login here</a>
                </div>
              </div>
              <div className="submit-btn">
                <button type="submit" className="">
                  Signup Now
                </button>
              </div>
            </form>
          </div>
        </div>
      </div>
    </>
  );
}
